def script_path():
    ''' change current path to script one '''
    current_path = os.path.realpath(os.path.dirname(sys.argv[0]))
    os.chdir(current_path)
    return current_path
    
    
def get_time(unix, file_form=False):
    ''' unix to time '''
    if file_form:
        date = str(datetime.datetime.fromtimestamp(unix).strftime("%H%M%S"))        # strftime("%Y%m%d_%H%M%S")
    else:
        date = str(datetime.datetime.fromtimestamp(unix).strftime("%H:%M:%S"))      # strftime("%Y-%m-%d %H:%M:%S")
    return date
    
    
def date_to_unix(date):
    ''' todo: make it more clear and useful '''
    items = [int(item) for item in date.split(':')]
    now = datetime.date.today()
    date = datetime.datetime.combine(now, datetime.time(items[0], items[1], items[2]))
    out = time.mktime(date.timetuple())
    return out
    
    
def compare_times(current, alarm_time):
    if current >= alarm_time:
        return True
    else:
        return False
        
        
